import { StyleSheet} from 'react-native';
const backButtonStyles = StyleSheet.create({
    icon:{
        color:"#fff",
        fontSize:30,
        marginLeft:5
    },
    div:{
        textAlign:"left",
        fontSize:30
    }
});
export {backButtonStyles};
